import React from "react";
import "./style.css";
import StartPage from "./elements/MainPage/StartPage";
import { Route, Routes } from "react-router-dom";

export default function MainPage() {
  return (
    <div className="main-page">
    <Routes>
      <Route element/>
    </Routes>
      <StartPage />
    </div>
  );
}
